import React from "react";
import './App.css';

function Play(props) {
    const {cartoons, click} = props;

  return (
   cartoons.map((item) => (
    <div key={item.id} id={item.title} className="card" onClick={click}>
     <img src={item.src} alt="cartoon"/>
     <h1>{item.title}</h1>
    </div>
   ))
  )

}

export default Play;
